import React from 'react';
import logo from '../components/images/logo.png';
import Button from '../components/buttons/Button';
import {Link} from 'react-router-dom'




const Header=()=>{
    return(
        <header style ={styles.header}>
         <div style={styles.center}>
         <Link to="/home" style={{color: 'black'}}>Home</Link>
         <Link to="/current" style={{color: 'black'}}>Current Conditions</Link>
        <img style ={styles.logo} src={logo} alt="Logo" />
        <Link to="/four" style={{color: 'black'}}>Four Day</Link>
        <Link to="/astro" style={{color: 'black'}}>Astrological Events</Link>
        </div>


        </header>
    )
}
export default Header

const styles ={

    header: {
            display: 'flex',
            flexDirection: 'row',
            justifyContent: 'space-between',
            alignItems: 'center',
            paddingLeft: 20,
            paddingRight: 20,
            paddingTop: 10,
            paddingBotom: 10,
            backgroundColor: '#FBF5F3',
            color: 'gray'
        },
    ltNav: {
            display: 'flex',
            alignItems: 'center',

        },
    left:{
        display: 'flex',
        flexDirection: 'row',

    },
    logo:{
        borderRadius: '50%',
        height: '50px',
        width: '60px',
        marginRight: '10%',
        alignItems: 'center' 
    },
    avatar:{
        height: '40px',
        width: '40px',
        border: '1px solid #eefc57',
        borderRadius: '50%',

    },
    center:{
        display: 'flex',
        justifyContent: 'center'
    },
    searchContainer:{
        border: '1px solid #eefc57',
        display: 'flex',
        flexDirection: 'row',
        backgroundColor:'gray'

    },
    inputIcon:{

        padding: '10px',
        display: 'flex',
        alignItems: 'center',
        fontSize: '1rem'
    },
    input:{
        border: '1px solid #eefc57',
        borderRadius: '10%',
        flex: 1,
        width: '70%',
        padding: '10px',
        backgroundColor: 'black',
        color: 'white'

    },
    rtNav: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        marginRight: '2%',
        justifyContent: 'space-between'

    },
    h1: {
     display: 'flex',
     flexDirection: 'row',
     alignItems: 'center',
     fontSize: '1rem',
     color: '#5fbff9'

    },
    button:{
        display: 'flex',
        fontSize: '14px'
    }

 }
